import React from 'react';
import './App.css';
import Header from './components/Header';
import TreeCounter from './components/TreeCounter';
import DonationForm from './components/DonationForm';

function App() {
  return (
    <div className="App">
      <Header />
      <TreeCounter count={1000} />
      <DonationForm />
    </div>
  );
}

export default App;
